@testset "1.1.1.4 (a+b x)^m (c+d x)^n (e+f x)^p (g+h x)^q" begin
    (A, B, a, b, c, d, e, f, g, h, i, m, n, p, x, ) = @variables A B a b c d e f g h i m n p x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(a+b*x)^m*(c+d*x)^n*(e+f*x)^p*(g+h*x)^q=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x)^m*(c+d*x)^n*(e+f*x)^p*(g+h*x)^q=#


    @test_int [(a+b*x)*(c+d*x)*(e+f*x)*(g+h*x), x, 2, a*c*e*g*x + (1/2)*(b*c*e*g + a*(d*e*g + c*f*g + c*e*h))*x^2 + (1/3)*(b*(d*e*g + c*f*g + c*e*h) + a*(d*f*g + d*e*h + c*f*h))*x^3 + (1/4)*(a*d*f*h + b*(d*f*g + d*e*h + c*f*h))*x^4 + (1/5)*b*d*f*h*x^5]
    @test_int [(a+b*x)*(c+d*x)*(e+f*x)/(g+h*x), x, 2, ((b*(d*g - c*h)*(f*g - e*h) - a*h*(d*f*g - d*e*h - c*f*h))*x)/h^3 + ((a*d*f*h - b*(d*f*g - d*e*h - c*f*h))*x^2)/(2*h^2) + (b*d*f*x^3)/(3*h) - ((b*g - a*h)*(d*g - c*h)*(f*g - e*h)*log(g + h*x))/h^4]
    @test_int [(a+b*x)*(c+d*x)/((e+f*x)*(g+h*x)), x, 2, (b*d*x)/(f*h) + ((b*e - a*f)*(d*e - c*f)*log(e + f*x))/(f^2*(f*g - e*h)) - ((b*g - a*h)*(d*g - c*h)*log(g + h*x))/(h^2*(f*g - e*h))]
    @test_int [(a+b*x)/((c+d*x)*(e+f*x)*(g+h*x)), x, 2, -(((b*c - a*d)*log(c + d*x))/((d*e - c*f)*(d*g - c*h))) + ((b*e - a*f)*log(e + f*x))/((d*e - c*f)*(f*g - e*h)) - ((b*g - a*h)*log(g + h*x))/((d*g - c*h)*(f*g - e*h))]
    @test_int [1/((a+b*x)*(c+d*x)*(e+f*x)*(g+h*x)), x, 2, (b^2*log(a + b*x))/((b*c - a*d)*(b*e - a*f)*(b*g - a*h)) - (d^2*log(c + d*x))/((b*c - a*d)*(d*e - c*f)*(d*g - c*h)) + (f^2*log(e + f*x))/((b*e - a*f)*(d*e - c*f)*(f*g - e*h)) - (h^2*log(g + h*x))/((b*g - a*h)*(d*g - c*h)*(f*g - e*h))]


    @test_int [x/((1 + x)*(2 + x)*(3 + x)), x, 2, (-(1/2))*log(1 + x) + 2*log(2 + x) - (3/2)*log(3 + x)]


    @test_int [(-x^2 + x^3)/((-6 + x)*(3 + 5*x)^3), x, 3, -(12/(1375*(3 + 5*x)^2)) + 201/(15125*(3 + 5*x)) + (20*log(6 - x))/3993 + (1493*log(3 + 5*x))/499125]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x)^m*(c+d*x)^n*(e+f*x)^p*(g+h*x)^(q/2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*x)^n*(c+d*x)^p*(e+f*x)^(q/2)=#


    @test_int [(a + b*x)^3*sqrt(c + d*x)*(e + f*x)/x, x, 6, 2*a^3*e*sqrt(c + d*x) + (2*(3*b*d*e - 2*b*c*f + 2*a*d*f)*(a + b*x)^2*(c + d*x)^(3/2))/(21*d^2) + (2*f*(a + b*x)^3*(c + d*x)^(3/2))/(9*d) + (2*(c + d*x)^(3/2)*(2*(20*a^3*d^3*f + 3*a^2*b*d^2*(45*d*e - 16*c*f) - 9*a*b^2*c*d*(7*d*e - 4*c*f) + 4*b^3*c^2*(3*d*e - 2*c*f)) + 3*b*d*(21*a*b*d^2*e - 4*(b*c - a*d)*(3*b*d*e - 2*b*c*f + 2*a*d*f))*x))/(315*d^4) - 2*a^3*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c))]
    @test_int [(a + b*x)^2*sqrt(c + d*x)*(e + f*x)/x, x, 5, 2*a^2*e*sqrt(c + d*x) + (2*f*(a + b*x)^2*(c + d*x)^(3/2))/(7*d) + (2*(c + d*x)^(3/2)*(2*(10*a^2*d^2*f - b^2*c*(7*d*e - 4*c*f) + 7*a*b*d*(5*d*e - 2*c*f)) + 3*b*d*(7*b*d*e - 4*b*c*f + 4*a*d*f)*x))/(105*d^3) - 2*a^2*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c))]
    @test_int [(a + b*x)^1*sqrt(c + d*x)*(e + f*x)/x, x, 4, 2*a*e*sqrt(c + d*x) - (2*(c + d*x)^(3/2)*(2*b*c*f - 5*d*(b*e + a*f) - 3*b*d*f*x))/(15*d^2) - 2*a*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c))]
    @test_int [(a + b*x)^0*sqrt(c + d*x)*(e + f*x)/x, x, 4, 2*e*sqrt(c + d*x) + (2*f*(c + d*x)^(3/2))/(3*d) - 2*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c))]
    @test_int [1/(a + b*x)^1*sqrt(c + d*x)*(e + f*x)/x, x, 6, (2*f*sqrt(c + d*x))/b - (2*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c)))/a + (2*sqrt(b*c - a*d)*(b*e - a*f)*atanh((sqrt(b)*sqrt(c + d*x))/sqrt(b*c - a*d)))/(a*b^(3/2))]
    @test_int [1/(a + b*x)^2*sqrt(c + d*x)*(e + f*x)/x, x, 6, ((b*e - a*f)*sqrt(c + d*x))/(a*b*(a + b*x)) - (2*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c)))/a^2 + ((2*b^2*c*e - a*d*(b*e + a*f))*atanh((sqrt(b)*sqrt(c + d*x))/sqrt(b*c - a*d)))/(a^2*b^(3/2)*sqrt(b*c - a*d))]
    @test_int [1/(a + b*x)^3*sqrt(c + d*x)*(e + f*x)/x, x, 7, ((b*e - a*f)*sqrt(c + d*x))/(2*a*b*(a + b*x)^2) + ((4*b^2*c*e - 3*a*b*d*e - a^2*d*f)*sqrt(c + d*x))/(4*a^2*b*(b*c - a*d)*(a + b*x)) - (2*sqrt(c)*e*atanh(sqrt(c + d*x)/sqrt(c)))/a^3 + ((8*b^3*c^2*e - 12*a*b^2*c*d*e + 3*a^2*b*d^2*e + a^3*d^2*f)*atanh((sqrt(b)*sqrt(c + d*x))/sqrt(b*c - a*d)))/(4*a^3*b^(3/2)*(b*c - a*d)^(3/2))]


    @test_int [sqrt(a + b*x)*(c + d*x)^3*(e + f*x)/x, x, 6, 2*c^3*e*sqrt(a + b*x) + (2*(3*b*d*e + 2*b*c*f - 2*a*d*f)*(a + b*x)^(3/2)*(c + d*x)^2)/(21*b^2) + (2*f*(a + b*x)^(3/2)*(c + d*x)^3)/(9*b) - (2*(a + b*x)^(3/2)*(2*(8*a^3*d^3*f - 12*a^2*b*d^2*(d*e + 3*c*f) - 5*b^3*c^2*(27*d*e + 4*c*f) + 3*a*b^2*c*d*(21*d*e + 16*c*f)) - 3*b*d*(21*b^2*c*d*e + 4*(b*c - a*d)*(3*b*d*e + 2*b*c*f - 2*a*d*f))*x))/(315*b^4) - 2*sqrt(a)*c^3*e*atanh(sqrt(a + b*x)/sqrt(a))]
    @test_int [sqrt(a + b*x)*(c + d*x)^2*(e + f*x)/x, x, 5, 2*c^2*e*sqrt(a + b*x) + (2*f*(a + b*x)^(3/2)*(c + d*x)^2)/(7*b) + (2*(a + b*x)^(3/2)*(2*(4*a^2*d^2*f - 7*a*b*d*(d*e + 2*c*f) + 5*b^2*c*(7*d*e + 2*c*f)) + 3*b*d*(7*b*d*e + 4*b*c*f - 4*a*d*f)*x))/(105*b^3) - 2*sqrt(a)*c^2*e*atanh(sqrt(a + b*x)/sqrt(a))]
    @test_int [sqrt(a + b*x)*(c + d*x)^1*(e + f*x)/x, x, 4, 2*c*e*sqrt(a + b*x) - (2*(a + b*x)^(3/2)*(2*a*d*f - 5*b*(d*e + c*f) - 3*b*d*f*x))/(15*b^2) - 2*sqrt(a)*c*e*atanh(sqrt(a + b*x)/sqrt(a))]
    @test_int [sqrt(a + b*x)*(c + d*x)^0*(e + f*x)/x, x, 4, 2*e*sqrt(a + b*x) + (2*f*(a + b*x)^(3/2))/(3*b) - 2*sqrt(a)*e*atanh(sqrt(a + b*x)/sqrt(a))]
    @test_int [sqrt(a + b*x)/(c + d*x)^1*(e + f*x)/x, x, 6, (2*f*sqrt(a + b*x))/d + (2*sqrt(b*c - a*d)*(d*e - c*f)*atan((sqrt(d)*sqrt(a + b*x))/sqrt(b*c - a*d)))/(c*d^(3/2)) - (2*sqrt(a)*e*atanh(sqrt(a + b*x)/sqrt(a)))/c]
    @test_int [sqrt(a + b*x)/(c + d*x)^2*(e + f*x)/x, x, 6, ((d*e - c*f)*sqrt(a + b*x))/(c*d*(c + d*x)) - ((2*a*d^2*e - b*c*(d*e + c*f))*atan((sqrt(d)*sqrt(a + b*x))/sqrt(b*c - a*d)))/(c^2*d^(3/2)*sqrt(b*c - a*d)) - (2*sqrt(a)*e*atanh(sqrt(a + b*x)/sqrt(a)))/c^2]
    @test_int [sqrt(a + b*x)/(c + d*x)^3*(e + f*x)/x, x, 7, ((d*e - c*f)*sqrt(a + b*x))/(2*c*d*(c + d*x)^2) - ((4*a*d^2*e - b*c*(3*d*e + c*f))*sqrt(a + b*x))/(4*c^2*d*(b*c - a*d)*(c + d*x)) - ((12*a*b*c*d^2*e - 8*a^2*d^3*e - b^2*c^2*(3*d*e + c*f))*atan((sqrt(d)*sqrt(a + b*x))/sqrt(b*c - a*d)))/(4*c^3*d^(3/2)*(b*c - a*d)^(3/2)) - (2*sqrt(a)*e*atanh(sqrt(a + b*x)/sqrt(a)))/c^3]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x)^m*(c+d*x)^n*(e+f*x)^(p/2)*(g+h*x)^(q/2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*x)^n*(c+d*x)^(p/2)*(e+f*x)^(q/2)=#


    @test_int [x^3*(1 + a*x)/(sqrt(a*x)*sqrt(1 - a*x)), x, 8, -((75*sqrt(a*x)*sqrt(1 - a*x))/(64*a^4)) - (25*(a*x)^(3/2)*sqrt(1 - a*x))/(32*a^4) - (5*(a*x)^(5/2)*sqrt(1 - a*x))/(8*a^4) - ((a*x)^(7/2)*sqrt(1 - a*x))/(4*a^4) - (75*asin(1 - 2*a*x))/(128*a^4)]
    @test_int [x^2*(1 + a*x)/(sqrt(a*x)*sqrt(1 - a*x)), x, 7, -((11*sqrt(a*x)*sqrt(1 - a*x))/(8*a^3)) - (11*(a*x)^(3/2)*sqrt(1 - a*x))/(12*a^3) - ((a*x)^(5/2)*sqrt(1 - a*x))/(3*a^3) - (11*asin(1 - 2*a*x))/(16*a^3)]
    @test_int [x^1*(1 + a*x)/(sqrt(a*x)*sqrt(1 - a*x)), x, 6, -((7*sqrt(a*x)*sqrt(1 - a*x))/(4*a^2)) - ((a*x)^(3/2)*sqrt(1 - a*x))/(2*a^2) - (7*asin(1 - 2*a*x))/(8*a^2)]
    @test_int [x^0*(1 + a*x)/(sqrt(a*x)*sqrt(1 - a*x)), x, 4, -((sqrt(a*x)*sqrt(1 - a*x))/a) - (3*asin(1 - 2*a*x))/(2*a)]
    @test_int [(1 + a*x)/(x^1*sqrt(a*x)*sqrt(1 - a*x)), x, 5, -((2*sqrt(1 - a*x))/sqrt(a*x)) - asin(1 - 2*a*x)]
    @test_int [(1 + a*x)/(x^2*sqrt(a*x)*sqrt(1 - a*x)), x, 3, -((2*a*sqrt(1 - a*x))/(3*(a*x)^(3/2))) - (10*a*sqrt(1 - a*x))/(3*sqrt(a*x))]
    @test_int [(1 + a*x)/(x^3*sqrt(a*x)*sqrt(1 - a*x)), x, 4, -((2*a^2*sqrt(1 - a*x))/(5*(a*x)^(5/2))) - (6*a^2*sqrt(1 - a*x))/(5*(a*x)^(3/2)) - (12*a^2*sqrt(1 - a*x))/(5*sqrt(a*x))]
    @test_int [(1 + a*x)/(x^4*sqrt(a*x)*sqrt(1 - a*x)), x, 5, -((2*a^3*sqrt(1 - a*x))/(7*(a*x)^(7/2))) - (26*a^3*sqrt(1 - a*x))/(35*(a*x)^(5/2)) - (104*a^3*sqrt(1 - a*x))/(105*(a*x)^(3/2)) - (208*a^3*sqrt(1 - a*x))/(105*sqrt(a*x))]
    @test_int [(1 + a*x)/(x^5*sqrt(a*x)*sqrt(1 - a*x)), x, 6, -((2*a^4*sqrt(1 - a*x))/(9*(a*x)^(9/2))) - (34*a^4*sqrt(1 - a*x))/(63*(a*x)^(7/2)) - (68*a^4*sqrt(1 - a*x))/(105*(a*x)^(5/2)) - (272*a^4*sqrt(1 - a*x))/(315*(a*x)^(3/2)) - (544*a^4*sqrt(1 - a*x))/(315*sqrt(a*x))]


    #= Integrands*are*equal. =#
    @test_int [(-1 + 2*a*x)/(x^2*sqrt(-1 + x)*sqrt(1 + x)), x, 4, -((sqrt(-1 + x)*sqrt(1 + x))/x) + 2*a*atan(sqrt(-1 + x)*sqrt(1 + x))]
    @test_int [(a^2*x^2 - (1 - a*x)^2)/(x^2*sqrt(-1 + x)*sqrt(1 + x)), x, 5, -((sqrt(-1 + x)*sqrt(1 + x))/x) + 2*a*atan(sqrt(-1 + x)*sqrt(1 + x))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x)^m*(c+d*x)^(n/2)*(e+f*x)^(p/2)*(g+h*x)^(q/2)=#


    @test_int [(A + B*x)/(sqrt(a + b*x)*sqrt(c + (b*(c - 1)*x)/a)*sqrt(e + (b*(e - 1)*x)/a)), x, 3, -((2*a^(3/2)*B*Elliptic.E(asin((sqrt(1 - c)*sqrt(a + b*x))/sqrt(a)), (1 - e)/(1 - c)))/(b^2*sqrt(1 - c)*(1 - e))) + (2*sqrt(a)*(a*B*e + A*(b - b*e))*Elliptic.F(asin((sqrt(1 - c)*sqrt(a + b*x))/sqrt(a)), (1 - e)/(1 - c)))/(b^2*sqrt(1 - c)*(1 - e))]
    @test_int [(A + B*x)/(sqrt(a + b*x)*sqrt(c + d*x)*sqrt(e + (b*(e - 1)*x)/a)), x, 5, -((2*a*B*sqrt((-b)*c + a*d)*sqrt((b*(c + d*x))/(b*c - a*d))*Elliptic.E(asin((sqrt(d)*sqrt(a + b*x))/sqrt((-b)*c + a*d)), -(((b*c - a*d)*(1 - e))/(a*d))))/(b^2*sqrt(d)*(1 - e)*sqrt(c + d*x))) + (2*sqrt(a)*(a*B*e + A*(b - b*e))*sqrt((b*(c + d*x))/(b*c - a*d))*Elliptic.F(asin((sqrt(1 - e)*sqrt(a + b*x))/sqrt(a)), -((a*d)/((b*c - a*d)*(1 - e)))))/(b^2*(1 - e)^(3/2)*sqrt(c + d*x))]


    #= ::Subsection::Closed:: =#
    #=p>0 & q>0=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(7 + 5*x)^3*sqrt(2 - 3*x)*sqrt(1 + 4*x)*sqrt(-5 + 2*x), x, 10, -((1182926269*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x))/1603800) - (12243139*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x))/356400 - (17561*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x)^2)/8910 - (427*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x)^3)/2970 + (2/55)*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x)^4 - (6489123157*sqrt(11)*sqrt(-5 + 2*x)*Elliptic.E(asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(699840*sqrt(5 - 2*x)) + (522167393*sqrt(11/6)*sqrt(5 - 2*x)*Elliptic.F(asin(sqrt(3/11)*sqrt(1 + 4*x)), 1/3))/(23328*sqrt(-5 + 2*x))]
    @test_int [(7 + 5*x)^2*sqrt(2 - 3*x)*sqrt(1 + 4*x)*sqrt(-5 + 2*x), x, 9, -((5256763*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x))/97200) - (8141*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x))/2700 - (61/270)*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x)^2 + (2/45)*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x)*(7 + 5*x)^3 - (17746949*sqrt(11)*sqrt(-5 + 2*x)*Elliptic.E(asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(29160*sqrt(5 - 2*x)) + (5592499*sqrt(11/6)*sqrt(5 - 2*x)*Elliptic.F(asin(sqrt(3/11)*sqrt(1 + 4*x)), 1/3))/(3888*sqrt(-5 + 2*x))]
    @test_int [(7 + 5*x)^1*sqrt(2 - 3*x)*sqrt(1 + 4*x)*sqrt(-5 + 2*x), x, 8, -((20911*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x))/3780) + (136/105)*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*(1 + 4*x)^(3/2) + (5/28)*sqrt(2 - 3*x)*(-5 + 2*x)^(3/2)*(1 + 4*x)^(3/2) - (954811*sqrt(11)*sqrt(-5 + 2*x)*Elliptic.E(asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(22680*sqrt(5 - 2*x)) + (72479*sqrt(11/6)*sqrt(5 - 2*x)*Elliptic.F(asin(sqrt(3/11)*sqrt(1 + 4*x)), 1/3))/(756*sqrt(-5 + 2*x))]
    @test_int [(7 + 5*x)^0*sqrt(2 - 3*x)*sqrt(1 + 4*x)*sqrt(-5 + 2*x), x, 7, (-(22/45))*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x) + (1/10)*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*(1 + 4*x)^(3/2) - (847*sqrt(11)*sqrt(-5 + 2*x)*Elliptic.E(asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(270*sqrt(5 - 2*x)) + (121*sqrt(11/6)*sqrt(5 - 2*x)*Elliptic.F(asin(sqrt(3/11)*sqrt(1 + 4*x)), 1/3))/(18*sqrt(-5 + 2*x))]
    @test_int [sqrt(2 - 3*x)*sqrt(1 + 4*x)*sqrt(-5 + 2*x)/(7 + 5*x)^1, x, 10, (2/15)*sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x) - (427*sqrt(11)*sqrt(-5 + 2*x)*Elliptic.E(asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(225*sqrt(5 - 2*x)) - (1253*sqrt(2/33)*sqrt(5 - 2*x)*Elliptic.F(asin(sqrt(3/11)*sqrt(1 + 4*x)), 1/3))/(375*sqrt(-5 + 2*x)) - (2691*sqrt(5 - 2*x)*Elliptic.Pi(55/124, asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(125*sqrt(11)*sqrt(-5 + 2*x))]
    @test_int [sqrt(2 - 3*x)*sqrt(1 + 4*x)*sqrt(-5 + 2*x)/(7 + 5*x)^2, x, 10, -((sqrt(2 - 3*x)*sqrt(-5 + 2*x)*sqrt(1 + 4*x))/(5*(7 + 5*x))) + (6*sqrt(11)*sqrt(-5 + 2*x)*Elliptic.E(asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(25*sqrt(5 - 2*x)) + (152*sqrt(2/33)*sqrt(5 - 2*x)*Elliptic.F(asin(sqrt(3/11)*sqrt(1 + 4*x)), 1/3))/(125*sqrt(-5 + 2*x)) + (26859*sqrt(5 - 2*x)*Elliptic.Pi(55/124, asin((2*sqrt(2 - 3*x))/sqrt(11)), -(1/2)))/(7750*sqrt(11)*sqrt(-5 + 2*x))]
